DELIMITER //
CREATE TRIGGER `update_amount` AFTER UPDATE ON `shortages`
 FOR EACH ROW BEGIN

    IF OLD.quantity != NEW.quantity OR OLD.rate != NEW.rate THEN
      
      CALL update_dr_cr_shrotage_amount(old.id, new.quantity*new.rate);
      CALL update_deduction_amount(old.trip_detail_id, new.quantity*new.rate, old.type);
    END IF;
    
  END
//
DELIMITER ;

